#!/bin/sh
# Auto-generated by `make lists`

# Install (or reinstall) everything
install () {
	npm -g install $npm_modules;
	gem install -N $ruby_gems;
	pip install $pip_packages;
	cd $(dirname "$0") && brew bundle
	
	eval "$(perl -I$HOME/perl5/lib/perl5 -Mlocal::lib)"
	cpan -i $cpan_modules;
}

